function addition(a, b){
    const add = a+b;
    return add;
}
function subtract(a, b){
    const subt = a-b;
    return subt;
}
function multiply(a, b){
    const mul = a*b;
    return mul;
}
function divide(a, b){
    const div = a/b;
    return div;
}

export default addition;
export {subtract, multiply, divide}
